import { useRouter } from 'vue-router/types/composables';
<template>
  <div class="GoodView">
    <h1>点赞页面</h1>
  </div>
</template>

<script>
export default {
  name: 'GoodView',
  created() {
    setTimeout(() => {
      this.$router.push({ name: 'home' })
    }, 3000)
  }
}
</script>

